create table teacher (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	title VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	dob DATE,
	avatar VARCHAR(50),
	current_city VARCHAR(50),
	current_state VARCHAR(50),
	current_postal VARCHAR(50),
	current_street_name VARCHAR(50),
	current_street_number VARCHAR(50),
	birth_city VARCHAR(50),
	birth_state VARCHAR(50),
	birth_country VARCHAR(50),
	ethnicity VARCHAR(50),
	phone_home VARCHAR(50),
	phone_cell VARCHAR(50),
	password VARCHAR(50),
	ssn VARCHAR(50),
	class_id VARCHAR(2),
	university VARCHAR(50)
);
